  01> BONE, David Forbes m on 14.04.1993 to NICHOLAS, Wendy Elizabeth
  b 31.12.1954
  b 29.03.1966
  David b. at Saltburn-by-the-Sea, Cleveland, England, and m. in Florida, USA. Wendy, d/o Alan
  William Nicholas and Muriel Margaret Clark, b. at Northwich, Cheshire, Address: 8 Elm Close,
  Endmoor, Kendal, Cumbria LA8 OEA, England.
  David was educated at primary school in Runcorn, Cheshire and at secondary schools in Liverpool and
  Helsby, Cheshire. He then attended teacher training college at St John's College, York where he
  gained a Bachelor of Education (Hons) degree. He taught in Cheshire for 11 years before becoming
  head teacher at Coniston Primary School in the Lake District of Cumbria. He moved to a second
  headship in Carlisle at Stanwix School for four years and during this time he completed a Masters
  Degree in Primary Education. He then took up his present position as a general inspector/ advisor
  in primary education for Cumbria Local Education Authority. David is a keen sailor, both inland
  and off-shore, and possesses a Yachtmaster's Certificate. He also enjoys running, mountain biking
  and generally keeping fit.
  Wendy and David met following David's divorce from Shirley Rydeard in 1988. Wendy is a primary
  school teacher at Westgate Primary School, Morecombe, Lancashire and is a keen musician who
  accompanies a local choral society and plays bassoon in the Westmorland Orchestra.
